window.bookSummaryJSON = "<p><b>The final book in <i>The Uncommon Series</i>, the best-selling tech startup thriller trilogy.</b> </p> <p>Mara Winkel is America's tech darling, CEO of the fastest-growing startup in the world. Her company, Mozaik, fights financial fraud with its revolutionary software and is hurtling towards a record-breaking IPO. </p> <p>But just as Mara and her team prepare for the ultimate success, the dark forces that have haunted them since the beginning move in for the kill. Will they free themselves and achieve their dream or be forever consigned to the shackles of criminal conspiracy on a global scale? </p> <p>The final book in <i>The Uncommon Series</i> is a frenetic pause-resister packed with relentless ambition, shadowy intrigue, and deadly brilliance. </p>"; 
